// JSX
import { Icon } from "@iconify/react";
import { Button, Container, Stack, Typography } from "@mui/material";
import ExperienceCard from "./ExperienceCard";
import { Link } from "react-router-dom";
import HireButton from "../../../component/HireButton";
import DownloadResume from "../../../component/DownloadResume";

export default function Slider() {
  return (
    <Container
      maxWidth="fluid"
      style={{
        backgroundImage: "url(./img/background.jpg)",
        height: "100vh",
        display: "flex",
        alignItems: "center",
        justifyContent: "center",
        flexDirection: "column",
      }}
      disableGutters
    >
      <Container
        maxWidth="lg"
        disableGutters
        sx={{
          direction: "column",
        }}
      >
        <Stack
          direction="row"
          justifyContent="space-between"
          alignItems="center"
          width="100%"
          mt={15}
        >
          <Stack>
            <Typography fontSize="45px" color="#FFFFFF59">
              Hello, I'm
            </Typography>
            <Typography fontSize="65px" fontWeight="bold" color="primary">
              Öznur Yılmaz
            </Typography>
            <Typography variant="h3" color="#fff">
              full stack developer
            </Typography>
            <Typography color="#ffffff80" mt={2} mb={2}>
              We denounce with righteous indignation dislike
              <br /> demoralized by the charms of pleasure
            </Typography>
            <Stack direction="row" alignItems="center" mt={3} spacing={2}>
              <HireButton />
              <DownloadResume />
            </Stack>
          </Stack>
        </Stack>
      </Container>
      <Stack direction="row" justifyContent="center" alignItems="end" mt={15}>
        <ExperienceCard />
      </Stack>
    </Container>
  );
}
